description:
Great classic.  Early(ish) Humphry Bogart in his soon to be signiture tough guy role.  Wonderful cast of actors.  Still watchable and interesting 80 years later.  This one is good for just about anyones collection.

Full screen, black and white, english only, no subs, dvdrip, excellent quality.


